IF OBJECT_ID('dbo.proc_transform_226', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_226;
GO
CREATE PROCEDURE dbo.proc_transform_226
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_226
    SET payload = LEFT(payload, 1000) + N'|V4-226|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_226;
END
